import React from 'react';

function About() {
    return (
        <div class='content1'>
            <h2 className="flex-logo">About Us</h2>
            <p className="flex-text">We specialize in responsible AI integration and development to increase revenue and improve customer experience.</p>
        </div>
    );
}

export default About;
